var title_f42_24_43403="Lifestyle modifications in HTN";
var content_f42_24_43403=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F62129&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F62129&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Lifestyle modifications in the management of hypertension",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Modification",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Approximate systolic BP reduction, range*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Weight reduction",
"       </td>",
"       <td>",
"        Maintain normal body weight (BMI, 18.5 to 24.9 kg/m2)",
"       </td>",
"       <td>",
"        5 to 20 mmHg per 10-kg weight loss",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adopt DASH eating plan",
"       </td>",
"       <td>",
"        Consume a diet rich in fruits, vegetables, and low-fat dairy products with a reduced content of saturated and total fat",
"       </td>",
"       <td>",
"        8 to 14 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dietary sodium reduction",
"       </td>",
"       <td>",
"        Reduce dietary sodium intake to no more than 100 meq/day (2.4 g sodium or 6 g sodium chloride)",
"       </td>",
"       <td>",
"        2 to 8 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical activity",
"       </td>",
"       <td>",
"        Engage in regular aerobic physical activity such as brisk walking (at least 30 minutes per day, most days of the week)",
"       </td>",
"       <td>",
"        4 to 9 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderation of alcohol consumption",
"       </td>",
"       <td>",
"        Limit consumption to no more than 2 drinks per day in most men and no more than 1 drink per day in women and lighter-weight persons",
"       </td>",
"       <td>",
"        2 to 4 mmHg",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    For overall cardiovascular risk reduction, stop smoking. The effects of implementing these modifications are dose and time dependent and could be higher for some individuals; they are not all additive.",
"    <div class=\"footnotes\">",
"     BMI: body mass index; BP: blood pressure; DASH: Dietary Approaches to Stop Hypertension.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: The Seventh Report of the Joint National Committee on Prevention, Detection, Evaluation, and Treatment of High Blood Pressure. Available at file://www.nhlbi.nih.gov/guidelines/hypertension/jnc7full.pdf.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
