"    Summary of the benefits of allocation to simvastatin therapy in the Heart Protection Study according to certain patient characteristics and medical therapies. The relative benefits of simvastatin therapy compared with placebo in terms of reduction in first major vascular events were significant in all patient groups, were significant in all patient groups and appeared to be additional to the benefits of other cardiovascular treatments such as treatment of hypertension and use of aspirin, beta blockers, and angiotensin converting enzyme (ACE) inhibitors.",
